import { cardData } from "../utils/mockData";
import {Card,QuoteIcon} from './styles';

const ClientSlide=() =>{
return (
    <div>
        {cardData.map((card,index) => 
              <Card key={index}>
             {/* <img src={card.Image} alt="card"/> */}
             <QuoteIcon src={card.quoteIcon} alt="Icon"/>
             <p>{card.para}</p>
             <h1>{card.name}</h1>
             <h3>{card.title}</h3>
             </Card>
            )
        }      
</div>
)
}
export default ClientSlide;
